import styled from "styled-components";

const Wrapper = styled.article`
  .alert-option {
    position: fixed;
    top: 50%;
    left: 50%;
    z-index: 44;
    width: 445px;
    height: 340px;
    background-color: white;
    transform: translate(-50%, -50%);
    display: none;
    box-shadow: 1px 0px 10px #b0afaf;
    padding: 30px;
  }
`;

export default Wrapper;
